zh:
{'name': '林上智 (SZ Lin)', 'bio': 'SZ 為 Linux 基金會官方專案 Civil Infrastructure Platform (城市基礎設施平台) 技術指導委員會成員並為 kernel 工作小組前任主席。 SZ 同時也為 Linux 基金會官方專案 OpenChain Project 治理委員會委員, 與來自不同產業的公司一同制定開源合規 (Open Source Compliance)之國際標準。
 
身為 Debian 開發者, SZ 長期在開放原始碼資安軟體團隊中進行維護及開發, 其中也包含協助維護 Kali Linux 軟體套件。

SZ 曾在多場國際會議中發表技術演講, 如 Embedded Linux Conference, Embedded Linux Conference Europe, Open Source Summit Japan, and Open Source Summit China 等等。'}

en:
{'name': '林上智 (SZ Lin)', 'bio': "SZ Lin is the technical steering committee member of the CIP (Civil Infrastructure Platform) project and governing board member in the OpenChain project.

Being a Debian developer, he mainly contributes and maintains open-source software in the security tools packaging team. He holds a master's degree in computer networking from National Chiao Tung University, Taiwan.

SZ has multiple speaking experiences, such as Embedded Linux Conference, Embedded Linux Conference Europe, Open Source Summit Japan, and Open Source Summit China."}

zh:
{'name': 'Dmitry S', 'bio': 'I am a passionate backend engineer with a mathematical background. I’m mostly about technical stuff, but my other passion - is measurement.

I live in the middle of Russia, in a small village in the Ural Mountains. I love to enjoy nature and spending time with my family of 3 kids.

As the Ruby developer, I am in OSS. I contribute as quiet as a ninja, after midnight when all the children got asleep.'}

