zh:
{'name': '李致緯', 'bio': '愛料理技術長與共同創辦人，樂愛開源技術，也喜歡應用技術於廣告行銷領域。

業餘時為 Google Developer Expert for Firebase、也是 LINE API Expert。2017 年亦被選為富比世亞洲30位30歲以下傑出青年。曾為 INSIDE 創辦人，於 2018 年由關鍵評論網收購。

可以透過 Facebook / Twitter 聯繫我：Richard Lee / dlackty 或可以撰寫 Email： dlackty@gmail.com'}

en:
{'name': 'Richard Lee', 'bio': "CTO and Co-founder at iCook. Love open source technologies and love tech application in ad and marketing. 

Besides my full-time job, I'm also selected as Google Developer Expert for Firebase, and LINE API Expert. In 2017, I was also listed in Forbes 30 Under 30 Asia. Previously founder of INSIDE, which was acquired by TNL Group in 2018.

Contact me via Facebook or Twitter: Richard Lee / dlackty Email: dlackty@gmail.com"}

{'name': 'HungWei Chiu', 'bio': 'HungWei started his career at Open Networking Foundation in 2019 and has been involved in various SDN-related open-source projects for years. He is working on integrating SDN concepts with Cloud-Native approaches to building a Kubernetes-based system for the 5G environment.

HungWei is one of the co-founders of SDNDS-TW and CNTUG, both are local communities based in Taiwan. SDNDS-TW focuses on the SDN and networking topics and CNTUG focuses on the Cloud Native approaches, in addition, HungWei devoted himself to share the knowledge and experience by writing blog posts and delivering the speech in various confluence and meetup, including COSCUP 2018 x openSUSE. Asia GNOME.Asia, Open Source Networking Days Taiwan, and so on.

In addition to public blog resources, he also teaches the Kubernetes and Linux Network via the online course platform and hosts a Facebook page 矽谷牛的耕田筆記(Technologynoteniu) to share the experience and knowledge.'}

