{'name': 'gasolin', 'bio': 'App/網頁開發者，開源愛好者，區塊鏈產業的邊緣人

開源跨鏈觀察工具 stakerwat.ch 與 ethhole.link 開發者
現負責 Bitfinex App 開發。'}

en:
{'name': 'gasolin', 'bio': 'Mobile/Web engineer and open source contributor. Observer at the edge of the blockchain industry.

The creator of the stakerwat.ch and ethhole.link, the web tool to check how tokens flow to Layer 2 and Sidechains from Ethereum.

Tech lead of Bitfinex App.'}

zh:
{'name': '范菁文', 'bio': '中央研究院 資訊科技創新研究中心 博士後研究員。

我走的路徑或許有些不太一樣，有點跨領域，有點斜槓。
人類學、社會學、國際人權法與政策研究  → → →  跨入科技社會與人權、資料科學與社會科技系統研究的學術領域，中間穿插實務聯合國人權工作、紀錄片影展策畫、表演藝術隨筆、周遊近20個國家。'}

en:
{'name': 'Rebecca C. Fan', 'bio': 'Postdoctoral Fellow, Research Center for Information Technology Innovation, National Science Park of Taiwan (currently known as Academia Sinica).

My path is perhaps a bit different, a bit interdisciplinary, and a bit slanted. 
From anthropology, sociology, international human rights law and politics → → → crossed over to the fields of technology and human rights, data science and socio-technical systems research, mixed with advocacy work for human rights at the United Nations, curating documentary film festival, writing random essays on performing arts, and global travel to nearly 20 countries.'}

zh:
{'name': 'Mohamed Shalan', 'bio': 'Mohamed Shalan is an associate professor (with tenure) at the Department of Computer Science and Engineering at the American University in Cairo. Also, he is a technical consultant with Efabless corporation. Before this, Mohamed assumed several roles with Mentor Graphics, Motorola, and Mindspeed.

Mohamed received his Ph.D., and MSc degrees in computer engineering from the Georgia Institute of Technology and Ain shams university. His research interests include open-source EDA, hardware/software codesign for embedded systems, and low-power computing systems.

Dr. Shalan has over 40 refereed publications. Also, he holds three U.S. patents.'}

